import React from 'react';
import { Activity, CheckCircle, XCircle } from 'lucide-react';

const formato = (timestamp) => {
    const date = new Date(timestamp);
    const options = {
        year: 'numeric',
        month: 'long',
        day: 'numeric',
        hour: '2-digit',
        minute: '2-digit',
        second: '2-digit'
    };
    return date.toLocaleString('pt-PT', options);
};

// Componente principal do modal
const CronLogs = ({ cron, onClose }) => {
    return (
        <div
            className="modal show d-block"
            tabIndex="-1"
            role="dialog"
            style={{ backgroundColor: 'rgba(0,0,0,0.5)' }}
        >
            <div className="modal-dialog modal-lg modal-dialog-centered" role="document">
                <div className="modal-content rounded-4 shadow-lg">
                    
                    <LogsHeader cronName={cron.name} onClose={onClose} />

                    <LogsContent logs={cron.logs || []} />

                </div>
            </div>
        </div>
    );
};

const LogsHeader = ({ cronName, onClose }) => (
    <div className="modal-header bg-primary text-white border-0 rounded-top-4">
        <h5 className="modal-title">Logs - {cronName}</h5>
        <button type="button" className="btn-close btn-close-white" aria-label="Close" onClick={onClose}></button>
    </div>
);

const LogsContent = ({ logs }) => {
    if (logs.length === 0) {
        return (
            <div className="modal-body text-center py-5">
                <Activity size={48} className="mb-3 text-secondary" />
                <p className="text-muted">Nenhum log encontrado</p>
            </div>
        );
    }

    return (
        <div className="modal-body p-4 bg-light rounded-bottom-4" style={{ maxHeight: '60vh', overflowY: 'auto' }}>
            {logs.map((log, index) => (
                <LogItem key={log.id || index} log={log} />
            ))}
        </div>
    );
};

const LogItem = ({ log }) => {
    const isSuccess = log.status === 'success';

    return (
        <div className={`mb-3 p-3 border-start rounded ${isSuccess ? 'border-success' : 'border-danger'}`}>
            <div className="d-flex justify-content-between mb-2">
                <span className={`fw-bold d-flex align-items-center gap-1 ${isSuccess ? 'text-success' : 'text-danger'}`}>
                    {isSuccess ? <CheckCircle size={16} /> : <XCircle size={16} />}
                    {isSuccess ? 'Sucesso' : 'Erro'}
                </span>
                <span className="text-muted small">{formato(log.timestamp)}</span>
            </div>

            <p className={`mb-2 small ${isSuccess ? 'text-success' : 'text-danger'}`}>
                {log.message}
            </p>

            {log.statusCode && <p className="small text-muted mb-1">Status Code: {log.statusCode}</p>}

            {log.responseData && <LogDetails title="Resposta" data={log.responseData} />}
            {log.error && <LogDetails title="Erro" data={log.error} isError />}
        </div>
    );
};

// Componente para mostrar detalhes expansíveis
const LogDetails = ({ title, data, isError }) => {
    return (
        <details className="mb-2">
            <summary className={`small ${isError ? 'text-danger' : 'text-muted'}`}>
                {title}
            </summary>
            <pre className="bg-white p-2 border rounded mt-1" style={{ overflowX: 'auto', fontSize: '0.8rem' }}>
                {typeof data === 'object' ? JSON.stringify(data, null, 2) : data}
            </pre>
        </details>
    );
};

export default CronLogs;
